import { uploadPhoto, createUser } from "./utils.js"

const asyncUploadUser = async () => {
    try {
        const photo = await uploadPhoto();
        const user = await createUser();

        return {
            photo: photo,
            user: user,
        }
    } catch (error) {
        console.error(error);

        return {
            photo: null,
            user: null,
        }
    }
}

export default asyncUploadUser;
